import React from 'react';

function Cart({ cart }) {
  const total = cart.reduce((sum, item) => sum + item.price, 0);

  return (
    <div>
      <h2>Your Cart</h2>
      {cart.map((item, index) => (
        <div key={index}>
          <h3>{item.name}</h3>
          <p>Price: ${item.price}</p>
        </div>
      ))}
      <h3>Total: ${total.toFixed(2)}</h3>
      <button>Proceed to Checkout</button>
    </div>
  );
}

export default Cart;
